import React, { Component } from 'react'
import NavButton from './NavButton/NavButton'

class NavBar extends Component {

    render() {
    return (
        <div>
            <NavButton name="Resume" handlePageChange={this.props.handlePageChange}/>
            <NavButton name="LinkedIn" handlePageChange={this.props.handlePageChange}/>
        </div>
    )

    }

}

export default NavBar;
